import React from "react";
import styled from "styled-components";
import Footer from "../Footer/Footer";
import Header from "../Header/Header";

const Main = styled.main``;
function Support() {
  return (
    <Main>
      <header>
        <Header />
      </header>
      <Footer />
    </Main>
  );
}

export default Support;
